    private static void createCompany(String id, String name)
    {
        CommandGateway gw = Spring.getBeanOfType(CommandGateway.class);
        CreateCompanyCommand cmd = new CreateCompanyCommand();
        cmd.setCompanyId(CompanyId.valueOf(id));
        cmd.setName(name);
        gw.sendAndWait(cmd);
    }

    private static void createComputer(String id, String name, String introduced, String discontinued, String companyId)
    {
        CommandGateway gw = Spring.getBeanOfType(CommandGateway.class);
        CreateComputerCommand cmd = new CreateComputerCommand();
        cmd.setComputerId(ComputerId.valueOf(id));
        cmd.setName(name);
        if(introduced != null)
        {
            cmd.setIntroduced(DateTime.parse(introduced).toDate());
        }
        if(discontinued != null)
        {
            cmd.setDiscontinued(DateTime.parse(discontinued).toDate());
        }
        if(companyId != null)
        {
            cmd.setCompanyId(CompanyId.valueOf(companyId));
        }
        gw.sendAndWait(cmd);
    }
